const expenses = [
    {
        id: 'e1',
        title: 'Toilet Paper',
        amount: 94.12,
        date: new Date(2020, 7, 14),
    },
    {
        id: 'e2',
        title: 'New TV',
        amount: 799.49,
        date: new Date(2021, 2, 12)
    },
    {
        id: 'e3',
        title: 'Car Insurance',
        amount: 294.67,
        date: new Date(2021, 2, 28),
    },
    {
        id: 'e4',
        title: 'New Desk (Wooden)',
        amount: 450,
        date: new Date(2021, 5, 12),
    },
];


function Expenses (expenses) {
    return (
        <div>
           { expenses.map(i =>
            <div className='expense-item'>
             <div>{i.date.toISOString()}</div>
             <div className='expense-item__description'>
               <h2>{i.title}</h2>
               <div className='expense-item__price'>${i.amount}</div>
             </div>
           </div>

           )
           }
        </div>
    )
}

export default Expenses;
